  `user_stat` int(3) DEFAULT 1 COMMENT '재직상태 : currently not used',
  `desc1` varchar(1024) DEFAULT NULL COMMENT 'Description : currently save pid ',
  `ip_otp` varchar(4) DEFAULT NULL COMMENT 'ip otp',
  `ins_dt` datetime DEFAULT NULL COMMENT '등록일시',
  `upt_dt` datetime DEFAULT NULL COMMENT '수정일시',
  `tj_dt` varchar(50) DEFAULT NULL COMMENT '퇴직날짜',
  `inner_server_no` int(4) DEFAULT 0 COMMENT 'inner server login server no (case multi server)',
