  `user_duty_name` varchar(32) DEFAULT NULL COMMENT '직위명',
  `in_integrity_stime` datetime DEFAULT NULL COMMENT '내부망 FM 무결성 검사 시작시간 20160511 배병찬',
  `in_integrity_etime` datetime DEFAULT NULL COMMENT '내부망 FM 무결성 검사 종료시간 20160511 배병찬',
